/** @typedef {import("cs_script/point_script").Vector} Vector */
/** @typedef {import("cs_script/point_script").Color} Color */
const PathState = {
    WALK: 1,//下一个点直走
    JUMP: 2,//下一个点需要跳跃
    LADDER: 3//下一个点是梯子点，可能是起点也可能是终点，到这个点开启梯子状态，直到下一个点不是梯子
};
//==============================世界相关设置=====================================
