const MESH_CELL_SIZE_Z = 1;                                // 体素高度
const MESH_TRACE_SIZE_Z = 32;                              // 射线方块高度//太高，会把竖直方向上的间隙也忽略
const MESH_WORLD_SIZE_XY = 6600;                           // 世界大小
const MESH_WORLD_SIZE_Z = 980;                             // 世界高度
//==============================Recast设置======================================
//其他参数
const MAX_SLOPE = 65;                                      // 最大坡度（度数），超过这个角度的斜面将被视为不可行走
