const TILE_SIZE = 512 / MESH_CELL_SIZE_XY;                 // 瓦片大小（体素单位），每个瓦片包含 tileSize*tileSize 个体素，过大可能导致性能问题，过小可能导致内存占用增加
const TILE_PADDING = AGENT_RADIUS + 1;                     // 瓦片边界添加的体素数量，防止寻路时穿模，值需要比MESH_ERODE_RADIUS大
