const REGION_MIN_AREA = 0;                                 // 最小区域面积（体素单位）
//轮廓生成参数
const CONT_MAX_ERROR = 1.5;                                // 原始点到简化后边的最大允许偏离距离（体素距离）
const POLY_MAX_VERTS_PER_POLY = 6;                         // 每个多边形的最大顶点数
